private void handleSpaceChar() throws TimelineParseException {
  if (currentParseState == ParseState.PARSING_VALUE) {
    if (startOffset == offset) {
      startOffset++;
    } else {
      createAndSetFilter(true);
      currentParseState = ParseState.PARSING_OP;
    }
  }
  offset++;
}
